ig.baked=true;ig.module('game.director.director').requires('impact.impact').defines(function(){ig.Director=ig.Class.extend({init:function(theGame,initialLevels){this.game=theGame;this.levels=[];this.currentLevel=0;var levelCopy=ig.copy(initialLevels);this.append(levelCopy);return this.loadLevel(this.currentLevel);},loadLevel:function(levelNumber){this.currentLevel=levelNumber;this.game.loadLevel(ig.copy(this.levels[levelNumber]));return true;},append:function(levels){newLevels=[];if(typeof(levels)==='object'){if(levels.constructor===(new Array).constructor){newLevels=levels;}
else{newLevels[0]=levels;}
this.levels=this.levels.concat(newLevels);return true;}
else{return false;}},nextLevel:function(){if(this.currentLevel+1<this.levels.length){return this.loadLevel(this.currentLevel+1);}
else{return false;}},previousLevel:function(){if(this.currentLevel-1>=0){return this.loadLevel(this.currentLevel-1);}
else{return false;}},jumpTo:function(requestedLevel){var levelNumber=null;for(i=0;i<this.levels.length;i++){if(this.levels[i]==requestedLevel){levelNumber=i;}}
if(levelNumber>=0){return this.loadLevel(levelNumber);}
else{return false;}},firstLevel:function(){return this.loadLevel(0);},lastLevel:function(){return this.loadLevel(this.levels.length-1);},reloadLevel:function(){return this.loadLevel(this.currentLevel);},pauseLevel:function(levelState){this.levelState=levelState;},unpauseLevel:function(){return this.levelState;}});});

